import React from 'react'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Link } from 'react-router-dom'
//import {withRouter} from 'react-router';

// import {useNavigate} from 'react-router-dom';


// const currentTab =(window,path)=>{

//   if(window.location.pathname===path){
//     return {color:"#FFFFFF"}
//   }else{
//     return {color:"#d1d1d1"}
//   }
// }

const Menu =() => {
  // const navigate = useNavigate();
  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark" className="p-3">
      <Container>
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link>
              {' '}
              <Link className=" text-white" to="/">
                Home
              </Link>
            </Nav.Link>
            <Nav.Link>
              {' '}
              <Link className=" text-white" to="/cart">
                Cart
              </Link>
            </Nav.Link>
            <Nav.Link>
              {' '}
              <Link className="text-white" to="/user/dashboard">
                Dashboard
              </Link>
            </Nav.Link>
            <Nav.Link>
              {' '}
              <Link className="text-white" to="/admin/dashboard">
                Admin Dashboard
              </Link>
            </Nav.Link>
            <Nav.Link>
              {' '}
              <Link className="text-white" to="/signin">
                Dashboard
              </Link>
            </Nav.Link>
            <Nav.Link>
              {' '}
              <Link className="text-white" to="/contact">
                Dashboard
              </Link>
            </Nav.Link>
          </Nav>
          <Nav className="gap-2">
            <Nav.Link className="btn btn-primary" href="#">Login</Nav.Link>
            <Nav.Link eventKey={2} className="btn btn-light text-black" href="#">
              Sign up
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>


  )
}

// export default withRouter(Menu)
export default Menu
